$(document).ready(function(){$(".slider").slick({autoplay:!0,autoplaySpeed:5e3,dots:!0,arrows:!0,adaptiveHeight:!0,prevArrow:'<button class="slick-prev" aria-label="Previous" type="button">Previous</button>',nextArrow:'<button class="slick-next" aria-label="Next" type="button">Next</button>',responsive:[{breakpoint:768,settings:{arrows:!1}}]}),$(".dot").click(function(){var t=$(this).index();$(".slider").slick("slickGoTo",t)})});